22-10-06','2022-10-06',NULL,'pwc@berea.edu','People Who Care'),(71,'Habitat for Humanity Cash for Trash Event',8,'The first volunteer service opportunity of the year - you will be joining the BC Habitat team as we clean trash, team bond, and fundraise money for the Madison/Clark County Habitat for Humanity Affiliate! The first 10 volunteers to RSVP will be those selected to join us. ','09:00:00','14:00:00','1564 Battlefield Memorial Hwy Richmond, KY 40475 ',0,1,1,0,'2022-10-08','2022-10-08',NULL,'habitat@berea.edu','Chase Ackerman'),(72,'Habitat for Humanity Restore Painting | Home Dedication ',8,'Join the Habitat Team this Saturday for a full day of volunteering. In the morning, there will be two separate locations that volunteers will be selected randomly to attend as needed - one being the Richmond Restore and the other being the home dedication lot in preparation for the ceremony being held there in the afternoon! The first 9 volunteers who sign up will be taken, and more information will be provided once the RSVP is filled.','09:00:00','15:00:00','Richmond & Winchester',0,1,1,0,'2022-10-15','2022-10-15',NULL,'habitat@berea.edu','Chase Ackerman'),(74,'Halloween Carnival',8,'Join AGP for a fun Halloween Carnival with treats and games at Irvine Nursing and Rehabilitation. \r\nPick up from Alumni Circle on Sunday, October 30th at 2 pm.\r\n\r\n','14:00:00','18:00:00','Irvine Nursing and Rehabilitation',0,1,1,0,'2022-10-30','2022-10-30',NULL,'agp@berea.edu','Aimee Ninahaza'),(75,'AGP Volunteer Opportunity - Dominion Senior Living Week 1',8,'We are excited to have you join us for our evenings at Dominion.\r\nWe\'ll take the first four volunteers to sign up.','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-01','2022-11-01',5,'agp@berea.edu','Aimee Ninahaza'),(76,'AGP Volunteer Opportunity - Dominion Senior Living Week 2',8,'We are excited to have you join us for our evenings at Dominion.\r\nWe\'ll take the first four volunteers to sign up.','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-08','2022-11-08',5,'agp@berea.edu','Aimee Ninahaza'),(77,'AGP Volunteer Opportunity - Dominion Senior Living Week 3',8,'We are excited to have you join us for our evenings at Dominion.\r\nWe\'ll take the first four volunteers to sign up.','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-15','2022-11-15',5,'agp@berea.edu','Aimee Ninahaza'),(78,'AGP Volunteer Opportunity - Dominion Senior Living Week 1 Week 1',8,'We are excited to have you join us for our evenings at Dominion.\r\nWe\'ll take the first four volunteers to sign up!','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-02','2022-11-02',6,'agp@berea.edu','Aimee Ninahaza'),(79,'AGP Volunteer Opportunity - Dominion Senior Living Week 1 Week 2',8,'We are excited to have you join us for our evenings at Dominion.\r\nWe\'ll take the first four volunteers to sign up!','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-09','2022-11-09',6,'agp@berea.edu','Aimee Ninahaza'),(80,'AGP Volunteer Opportunity - Dominion Senior Living Week 1 Week 3',8,'We are excited to have you join us for our evenings at Dominion.\r\nWe\'ll take the first four volunteers to sign up!','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-16','2022-11-16',6,'agp@berea.edu','Aimee Ninahaza'),(81,'Vibez with BTM  Week 1',8,'A program made to give students a safe space to be themselves, stimulate creativity and we get to re-introduce ourselves back into the Berea community. ','15:00:00','17:30:00','Stephenson Hall - Arts & Crafts 208',0,0,1,0,'2022-10-31','2022-10-31',7,'bereateenmentoring@berea.edu','Leslie Bell'),(82,'Vibez with BTM  Week 2',8,'A program made to give students a safe space to be themselves, stimulate creativity and we get to re-introduce ourselves back into the Berea community. ','15:00:00','17:30:00','Stephenson Hall - Arts & Crafts 208',0,0,1,0,'2022-11-07','2022-11-07',7,'bereateenmentoring@berea.ed