ekly program of the semester for Christmas caroling and reading with Dominion residents! ','17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-11-30','2022-11-30',NULL,'agp@berea.edu','Aimee Ninahaza'),(89,'Habitat End of the Semester Restore Trip',8,'Join the Habitat team for the final volunteer trip of the year, where we will spend our day at the Richmond Restore - doing a wide variety of tasks. There will be a total of 4 volunteer openings available, so please RSVP quickly if you would like to come! ','10:00:00','15:00:00','Richmond Restore',0,1,1,0,'2022-12-03','2022-12-03',NULL,'habitat@berea.edu','Chase Ackerman');
